INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (1, 'Idrivelongtimee', 'This is a good, very reliable, cheap to operate little car. No bueno when there is more than a few inchees of snow, but you can''t expect much.', '2016-02-18', 5);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (3, 'Joe Rindfuss', 'My main complaint is the Navigation System – I would recommend skipping this option and buying a GPS since the Chrysler navigation system WILL get you lost.', '2015-11-16', 4);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (5, 'Nik', 'the alignment or something is off... You can''t hold the damn car straight in one lane. No matter how straight and steady you hold the steering wheel, you still end up swerving and veering into someone else''s lane. Additional complaint: the worst acceleration that I''ve ever experienced in a vehicle... good luck pulling a heel.', '2015-09-12', 1);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (6, 'lltautomobile', 'This is still the king of family haulers. It is comfortable and has a smooth ride. Quiet interior with little road noise.', '2015-04-13', 4);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (8, 'Kris C.', 'The design is great. The ride is comfortable. The steering is smooth and effortless. The engine is quiet and moderately powerful. The HVAC performs flawlessly.', '2016-02-26', 5);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (10, 'Dan', 'Purchased this 2013 limited used in 2014 and have owned it about one year. Nicest car I''ve ever owned. It looks nice, drives well, is quiet and very comfortable. I haven''t had any problems with it.', '2015-07-27', 5);
INSERT INTO "Review" ("vID", "userName", text, date, rating) VALUES (15, 'Denny Y', 'Ford finally put quality into the ''15 Stang! This sexy eye catcher is a great summer ride. Rides and handles like a dream and is extremely comfortable. My only complaint is the poor grip on wet and almost dangerous on snowy roads even with their std All Weather Eagle GTs.', '2015-12-31', 5);
